import React, {Component} from 'react';
import './App.css';

class ButtonWorld extends Component {
    constructor(props) {
        super(props);
    }

    //variables
    btn_height;
    render(){
        return (
            <img src={this.props.btn_src} class="btn" id="btn"/>

        )
    }
    componentWillMount() {
        let btn_height = this.props.init_height;
        if(this.props.btn_size = "l"){
            btn_height = btn_height*0.13;
        }
        else if(this.props.btn_size = "m"){
            btn_height = btn_height*0.07;
        }
        else if(this.props.btn_size="s"){
            btn_height = btn_height*0.02;
        }
        else{
            alert("btn error");
        }
        document.getElementById("btn").setAttribute("style", ("height: " + btn_height + "px"));
    }

    onClick(){

    }
}

export default ButtonWorld;
